export const newUser = {
  type: "NEW_USER"
};

const initialState = {
  users: [
    {
      nome: "Gabriel",
      sobrenome: "Luiz",
      rg: 123456789,
      orgao: "detran",
      uf: "RJ",
      nascimento: "01051997",
      cpf: 123,
      email: "gabriel@test.com",
      telefone: "21123456",
      senha: 123
    }
  ]
};
const SignUpReducer = (state = [], action) => {
  switch (action.type) {
    case "NEW_USER":
      return { ...state, users: state.users };
    default:
      return state;
  }
};

export default SignUpReducer;
